import './App.css';
import Header from './components/Header.js';
import About from './components/About';
import Home from './components/Home.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <>
    <Router>
    <div className="App">
       <Header/>
       <Home/>
       <Switch>
         <Route exact path="/about">
           <About />
         </Route>
       </Switch>
    </div>
    </Router>
    </>
  );
}

export default App;
